        <script type="application/json" id="1866">
          {"8bd385fb-3830-472a-823f-7f9868e6ba96":{"defs":[],"roots":{"references":[{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{},"id":"1233","type":"AllLabels"},{"attributes":{"source":{"id":"1177"}},"id":"1201","type":"CDSView"},{"attributes":{"source":{"id":"1002"}},"id":"1034","type":"CDSView"},{"attributes":{"below":[{"id":"1189"}],"center":[{"id":"1192"},{"id":"1195"}],"left":[{"id":"1193"}],"name":"bandwidth_type_histogram","renderers":[{"id":"1200"}],"sizing_mode":"stretch_both","title":{"id":"1179"},"toolbar":{"id":"1196"},"toolbar_location":null,"x_range":{"id":"1181"},"x_scale":{"id":"1185"},"y_range":{"id":"1183"},"y_scale":{"id":"1187"}},"id":"bk-bandwidth-type-plot","subtype":"Figure","type":"Plot"},{"attributes":{"data_source":{"id":"1002"},"glyph":{"id":"1031"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1034"}},"id":"1033","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"1177"},"glyph":{"id":"1198"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"view":{"id":"1201"}},"id":"1200","type":"GlyphRenderer"},{"attributes":{"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 193.63 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 634 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 1437.09 s &lt;/li&gt;\n&lt;li&gt; transfer time: 737.60 ms &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:34937 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 8 &lt;/li&gt;\n          &lt;li&gt; Memory: 612.00 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main(args):\n    \"\"\"Multi-GPU Criteo/DLRM Preprocessing Benchmark\n\n    This benchmark is designed to measure the time required to preprocess\n    the Criteo (1TB) dataset for Facebook\u2019s DLRM model.  The user must specify\n    the path of the raw dataset (using the `--data-path` flag), as well as the\n    output directory for all temporary/final data (using the `--out-path` flag)\n\n    Example Usage\n    -------------\n\n    python dask-nvtabular-criteo-benchmark.py\n                        --data-path /path/to/criteo_parquet --out-path /out/dir/`\n\n\n    Dataset Requirements (Parquet)\n    ------------------------------\n\n    This benchmark is designed with a parquet-formatted dataset in mind.\n    While a CSV-formatted dataset can be processed by NVTabular, converting\n    to parquet will yield significantly better performance.  To convert your\n    dataset, try using the `optimize_criteo.ipynb` notebook (also located\n    in `NVTabular/examples/`)\n\n    For a detailed parameter overview see `NVTabular/examples/MultiGPUBench.md`\n    \"\"\"\n\n    logging.info('Starting the job')\n\n\n    # Input\n    data_path = args.data_path[:-1] if args.data_path[-1] == \"/\" else args.data_path\n    freq_limit = args.freq_limit\n    out_files_per_proc = args.out_files_per_proc\n    high_card_columns = args.high_cards.split(\",\")\n    dashboard_port = args.dashboard_port\n    if args.protocol == \"ucx\":\n        UCX_TLS = os.environ.get(\"UCX_TLS\", \"tcp,cuda_copy,cuda_ipc,sockcm\")\n        os.environ[\"UCX_TLS\"] = UCX_TLS\n\n    # Cleanup output directory\n    base_dir = args.out_path[:-1] if args.out_path[-1] == \"/\" else args.out_path\n    dask_workdir = os.path.join(base_dir, \"workdir\")\n    output_path = os.path.join(base_dir, \"output\")\n    stats_path = os.path.join(base_dir, \"stats\")\n    setup_dirs(base_dir, dask_workdir, output_path, stats_path)\n\n    # Use Criteo dataset by default (for now)\n    cont_names = (\n        args.cont_names.split(\",\") if args.cont_names else [\"I\" + str(x) for x in range(1, 14)]\n    )\n    cat_names = (\n        args.cat_names.split(\",\") if args.cat_names else [\"C\" + str(x) for x in range(1, 27)]\n    )\n    label_name = [\"label\"]\n\n    # Specify Categorify/GroupbyStatistics options\n    tree_width = {}\n    cat_cache = {}\n    for col in cat_names:\n        if col in high_card_columns:\n            tree_width[col] = args.tree_width\n            cat_cache[col] = args.cat_cache_high\n        else:\n            tree_width[col] = 1\n            cat_cache[col] = args.cat_cache_low\n\n    # Use total device size to calculate args.device_limit_frac\n    device_size = device_mem_size(kind=\"total\")\n    device_limit = int(args.device_limit_frac * device_size)\n    device_pool_size = int(args.device_pool_frac * device_size)\n    part_size = int(args.part_mem_frac * device_size)\n\n    # Parse shuffle option\n    shuffle = None\n    if args.shuffle == \"PER_WORKER\":\n        shuffle = nvt_io.Shuffle.PER_WORKER\n    elif args.shuffle == \"PER_PARTITION\":\n        shuffle = nvt_io.Shuffle.PER_PARTITION\n\n    # Check if any device memory is already occupied\n    for dev in args.devices.split(\",\"):\n        fmem = _pynvml_mem_size(kind=\"free\", index=int(dev))\n        used = (device_size - fmem) / 1e9\n        if used &gt; 1.0:\n            warnings.warn(f\"BEWARE - {used} GB is already occupied on device {int(dev)}!\")\n\n    logging.info('Creating the LocalCUDACluster')\n\n    # Setup LocalCUDACluster\n    if args.protocol == \"tcp\":\n        cluster = LocalCUDACluster(\n            protocol=args.protocol,\n            n_workers=args.n_workers,\n            CUDA_VISIBLE_DEVICES=args.devices,\n            device_memory_limit=device_limit,\n            local_directory=dask_workdir,\n            dashboard_address=\":\" + dashboard_port,\n        )\n    else:\n        cluster = LocalCUDACluster(\n            protocol=args.protocol,\n            n_workers=args.n_workers,\n            CUDA_VISIBLE_DEVICES=args.devices,\n            enable_nvlink=True,\n            device_memory_limit=device_limit,\n            local_directory=dask_workdir,\n            dashboard_address=\":\" + dashboard_port,\n        )\n    client = Client(cluster)\n\n    logging.info('Setting up the RMM pool.')\n    # Setup RMM pool\n    if args.device_pool_frac &gt; 0.01:\n        setup_rmm_pool(client, device_pool_size)\n\n    # Define Dask NVTabular \"Workflow\"\n    if args.normalize:\n        cont_features = cont_names &gt;&gt; ops.FillMissing() &gt;&gt; ops.Normalize()\n    else:\n        cont_features = cont_names &gt;&gt; ops.FillMissing() &gt;&gt; ops.Clip(min_value=0) &gt;&gt; ops.LogOp()\n\n    cat_features = cat_names &gt;&gt; ops.Categorify(\n        out_path=stats_path,\n        tree_width=tree_width,\n        cat_cache=cat_cache,\n        freq_threshold=freq_limit,\n        search_sorted=not freq_limit,\n        on_host=not args.cats_on_device,\n    )\n    processor = Workflow(cat_features + cont_features + label_name, client=client)\n    \n    logging.info(f'Data_path: {data_path}')\n\n    logging.info('Creating Dataset') \n    dataset = Dataset(data_path, \"parquet\", part_size=part_size)\n\n    # Execute the dask graph\n    runtime = time.time()\n\n    start_time = time.time()\n    logging.info(\"Starting fitting the preprocessing workflow on a training dataset\")\n    processor.fit(dataset)\n    end_time = time.time()\n    fit_elapsed_time = end_time - start_time\n    logging.info('Fitting completed. Elapsed time: {}'.format(fit_elapsed_time))\n\n    start_time = time.time()\n    logging.info(\"Starting the preprocessing workflow. \")\n\n    if args.profile is not None:\n        with performance_report(filename=args.profile):\n            processor.transform(dataset).to_parquet(\n                output_path=output_path,\n                num_threads=args.num_io_threads,\n                shuffle=shuffle,\n                out_files_per_proc=out_files_per_proc,\n            )\n    else:\n        processor.transform(dataset).to_parquet(\n            output_path=output_path,\n            num_threads=args.num_io_threads,\n            shuffle=shuffle,\n            out_files_per_proc=out_files_per_proc,\n        )\n    end_time = time.time()\n    process_elapsed_time = end_time - start_time\n    logging.info('Processing completed.')\n    \n    runtime = time.time() - runtime\n\n    logging.info(\"\\nDask-NVTabular DLRM/Criteo benchmark\")\n    logging.info(\"--------------------------------------\")\n    logging.info(f\"partition size     | {part_size}\")\n    logging.info(f\"protocol           | {args.protocol}\")\n    logging.info(f\"device(s)          | {args.devices}\")\n    logging.info(f\"rmm-pool-frac      | {(args.device_pool_frac)}\")\n    logging.info(f\"out-files-per-proc | {args.out_files_per_proc}\")\n    logging.info(f\"num_io_threads     | {args.num_io_threads}\")\n    logging.info(f\"shuffle            | {args.shuffle}\")\n    logging.info(f\"cats-on-device     | {args.cats_on_device}\")\n    logging.info(\"======================================\")\n    logging.info(f\"Total runtime[s]       | {runtime}\")\n    logging.info(\"======================================\\n\")\n    logging.info(f\"Fit runtime[s]         | {fit_elapsed_time}\")\n    logging.info(\"======================================\\n\")\n    logging.info(f\"Process runtime[s]     | {process_elapsed_time}\")\n    logging.info(\"======================================\\n\")\n\n    client.close()\n\n    print('Copying file back to gcs.')\n    os.system('gsutil -m cp /output/* gs://renatoleite-staging/output/')\n    os.system('gsutil -m cp /report/* gs://renatoleite-staging/report/')\n    print('Done copying.')\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"callback":null,"point_policy"
